import "./App.css";
import Navbar from "./components/navbar/Navbar";
import Routes from "./components/routes/Routes";
import Post from "./components/features/post";
import PostForm from "./components/features/postForm";

function App() {
    return (
        <div className="App">
            <Navbar />
            <Routes />
            <PostForm />
            <Post />
        </div>
    );
}

export default App;
